Sometimes it’s necessary to build some native C or C++ code as part of a package. This is another excellent use case of leveraging the build script to build a native library before the Rust crate itself. As an example, we’ll create a Rust library which calls into C to print “Hello, World!”. Like above, let’s first take a look at the package layout: .
├── Cargo.toml
├── build.rs
└── src ├── hello.c └── main.rs 1 directory, 4 files Pretty similar to before! Next, the manifest: # Cargo.toml [package]
name = "hello-world-from-c"
version = "0.1.0"
edition = "2021" For now we’re not going to use any build dependencies, so let’s take a look at the build script now: // build.rs use std::process::Command;
use std::env;
use std::path::Path; fn main() { let out_dir = env::var("OUT_DIR").unwrap(); // Note that there are a number of downsides to this approach, the comments // below detail how to improve the portability of these commands. Command::new("gcc").args(&["src/hello.c", "-c", "-fPIC", "-o"]) .arg(&format!("{}/hello.o", out_dir)) .status().unwrap(); Command::new("ar").args(&["crus", "libhello.a", "hello.o"]) .current_dir(&Path::new(&out_dir)) .status().unwrap(); println!("cargo:rustc-link-search=native={}", out_dir); println!("cargo:rustc-link-lib=static=hello"); println!("cargo:rerun-if-changed=src/hello.c");
} This build script starts out by compiling our C file into an object file (by invoking gcc) and then converting this object file into a static library (by invoking ar). The final step is feedback to Cargo itself to say that our output was in out_dir and the compiler should link the crate to libhello.a statically via the -l static=hello flag. Note that there are a number of drawbacks to this hard-coded approach: The gcc command itself is not portable across platforms. For example it’s unlikely that Windows platforms have gcc, and not even all Unix platforms may have gcc. The ar command is also in a similar situation. These commands do not take cross-compilation into account. If we’re cross compiling for a platform such as Android it’s unlikely that gcc will produce an ARM executable. Not to fear, though, this is where a build-dependencies entry would help! The Cargo ecosystem has a number of packages to make this sort of task much easier, portable, and standardized. Let's try the cc crate from crates.io . First, add it to the build-dependencies in Cargo.toml: [build-dependencies]
cc = "1.0" And rewrite the build script to use this crate: // build.rs fn main() { cc::Build::new() .file("src/hello.c") .compile("hello"); println!("cargo:rerun-if-changed=src/hello.c");
} The cc crate abstracts a range of build script requirements for C code: It invokes the appropriate compiler (MSVC for windows, gcc for MinGW, cc for Unix platforms, etc.). It takes the TARGET variable into account by passing appropriate flags to the compiler being used. Other environment variables, such as OPT_LEVEL, DEBUG, etc., are all handled automatically. The stdout output and OUT_DIR locations are also handled by the cc library. Here we can start to see some of the major benefits of farming as much functionality as possible out to common build dependencies rather than duplicating logic across all build scripts! Back to the case study though, let’s take a quick look at the contents of the src directory: // src/hello.c #include <stdio.h> void hello() { printf("Hello, World!\n");
} // src/main.rs // Note the lack of the `#[link]` attribute. We’re delegating the responsibility
// of selecting what to link over to the build script rather than hard-coding
// it in the source file.
extern { fn hello(); } fn main() { unsafe { hello(); }
} And there we go! This should complete our example of building some C code from a Cargo package using the build script itself. This also shows why using a build dependency can be crucial in many situations and even much more concise! We’ve also seen a brief example of how a build script can use a crate as a dependency purely for the build process and not for the crate itself at runtime.

